import React from 'react';
import Topbar from './Topbar';
import Menu from './Menu';
import Banner from './Banner';
import Frame69 from './Frame69';

function App() {
  return (
    <div
      style={{
        width: '100%',
        maxWidth: '1440px',
        margin: '0 auto',
        boxSizing: 'border-box',
        display: 'flex',
        flexDirection: 'column',
        minHeight: '100vh',
      }}
    >
      <Topbar />
      <Menu />
      <Banner />
      <Frame69 />
      {/* Add other frames/components here */}
    </div>
  );
}

export default App;
